import React from "react";
import styles from './index.module.scss';

export class Input extends React.Component<any, any> {
    render() {
        return (
            <input type="text" autoComplete="off" value={this.props.value}  onChange={(e) => {this.props.onChange(e)}} />
        );
    }
}

export class Textarea extends React.Component<any, any> {
    render() {
        return (
            <textarea autoComplete="off" value={this.props.value}  onChange={() => {this.props.onChange()}} />
        );
    }
}

class TravelForm extends React.Component<any, any> {
    constructor(props) {
        super(props);
        this.state = {
            inputs: Array(7).fill([]),
            textareas: Array(3).fill(''),
        };
    }

    inputChange = (i, event) => {
        console.log(event.target.value);
        const inputs = this.state.inputs.slice();
        inputs[i] = event.target.value
        this.setState({inputs: inputs})
    }

