    }

    renderInput(i) {
        return (
            <Input value={this.state.inputs[i]} onChange={this.inputChange} />
        );
    }

    renderTextarea(i) {
        return (
            <Textarea value={this.state.textareas[i]} onChange={(i) => {this.textareaChange(i)}} />
        );
    }

    render() {
        return (
            <div>
                <div className={styles.inputForm}>
                    姓名：{this.renderInput(0)}
                    电话：{this.renderInput(1)}
                    出发地：{this.renderInput(2)}
                    旅行时间：{this.renderInput(3)}
                    旅行人数：{this.renderInput(4)}
                    老人人数：{this.renderInput(5)}
                    孩子人数：{this.renderInput(6)}
                </div>
                <div className={styles.textareaFrom}>
                    旅行城市：{this.renderTextarea(0)}
                    必玩景区：{this.renderTextarea(1)}
                    备注：{this.renderTextarea(2)}
                </div>
            </div>
        );
    }
}

